import { Box } from "@mui/material";
import React from "react";
import ButtonHeader from "./Button";

const Header = () => {
  return (
    <Box
      sx={{
        background: "blue",
        width: "100%",
        height: "112px",
      }}
    >
      <div>
        <div>TÜM ALT BAŞLIKLAR</div>
        <div>
          <ButtonHeader />
        </div>
      </div>
    </Box>
  );
};

export default Header;
